essentials/examples.html.body:
Examples
Toasts
Simple, Success, Info, Warning, Error
vm.$snotify.success('Example body content');
vm.$snotify.success('Example body content', 'Example Title');
vm.$snotify.success('Example body content', {
  timeout: 2000,
  showProgressBar: false,
  closeOnClick: false,
  pauseOnHover: true
});
vm.$snotify.success('Example body content', 'Example title', {
  timeout: 2000,
  showProgressBar: false,
  closeOnClick: false,
  pauseOnHover: true
});

Async
Error
You should pass Promise of type Snotify to change some data or do some other actions  
    this.$snotify.async('Called with promise', 'Error async', () => new Promise((resolve, reject) => {
      setTimeout(() => reject({
        title: 'Error!!!',
        body: 'We got an example error!',
        config: {
          closeOnClick: true
        }
      }), 2000);
    }));

Success
    this.$snotify.async('Called with promise', 'Success async', () => new Promise((resolve, reject) => {
      setTimeout(() => resolve({
        title: 'Success!!!',
        body: 'We got an example success!',
        config: {
          closeOnClick: true
        }
      }), 2000);
    }));

Prompt & Validation
const yesAction = (toast: SnotifyToast) => {
  if (!toast.value.match('snotify')) {
    toast.valid = false;
    return false;
  } else {
    toast.valid = true; // default value
    vm.$snotify.remove(toast.id)
  }
}

const noAction = (toast: SnotifyToast) => {
  vm.$snotify.remove(toast.id) // default
}

vm.$snotify.prompt('Example body content', 'Example title', {
  buttons: [
    {text: 'Yes', action: yesAction, bold: true },
    {text: 'No', action: noAction },
  ],
  placeholder: 'This is the example placeholder which you can pass'
});

Confirm
vm.$snotify.confirm('Example body content', 'Example title', {
  timeout: 5000,
  showProgressBar: true,
  closeOnClick: false,
  pauseOnHover: true,
  buttons: [
    {text: 'Yes', action: () => console.log('Clicked: Yes'), bold: false},
    {text: 'No', action: () => console.log('Clicked: No')},
    {text: 'Later', action: (toast) => {console.log('Clicked: Later'); vm.$snotify.remove(toast.id); } },
    {text: 'Close', action: (toast) => {console.log('Clicked: No'); vm.$snotify.remove(toast.id); }, bold: true},
  ]
});

Html
vm.$snotify.html(`Html Bold Title
  Html toast content `, {
  timeout: 5000,
  showProgressBar: true,
  closeOnClick: false,
  pauseOnHover: true,
});

Callbacks
toast.on('mounted', (toast) => {
  console.log('[CALLBACK]: mounted', toast)
});

toast.on('input', (toast) => {
  if (!toast.value.match('snotify')) {
      toast.valid = false;
      return false;
    } else {
      toast.valid = true; // default value
      vm.$snotify.remove(toast.id)
    }
});

Custom icon
Icon viewport is set to 48x48 pixels.
vm.$snotify.simple('Example body content', 'Example title!', {
  timeout: 2000,
  showProgressBar: false,
  closeOnClick: true,
  icon: 'assets/custom-svg.svg'
});

Of course you can pass an url, for example http://placeholde.it/48x100 (this resource will generate us an image with 48x100 dimension).And apply object-fit to .snotify-icon class in your styles
.snotify-icon {
  object-fit: cover;
  width: 100%;
  height: 100%;
  object-position: center;
}

essentials/animations.html.body:
Animations
You are free to create or copy any css animations.
1. Add you animation styles into your global styles
In this example i just copied one of animate.css animations
.bounceInDown {
  animation-name: bounceInDown;
}


@keyframes bounceInDown {
  0%, 60%, 75%, 90%, 100% {
    transition-timing-function: cubic-bezier(0.215, 0.610, 0.355, 1.000);
  }

  0% {
    opacity: 0;
    transform: translate3d(0, -3000px, 0) scaleY(5);
  }

  60% {
    opacity: 1;
    transform: translate3d(0, 25px, 0) scaleY(.9);
  }

  75% {
    transform: translate3d(0, -10px, 0) scaleY(.95);
  }

  90% {
    transform: translate3d(0, 5px, 0) scaleY(.985);
  }

  100% {
    opacity: 1;
    transform: none;
  }
}

2. Now i would call my notification like that
vm.$snotify.success(this.body, this.title, {
  animation: {
    enter: 'bounceInDown',
    exit: 'bounceInDown',
    time: 1000
  }
});

essentials/styling.html.body:
Styling

Note. I'am using scss syntax. And there is no default theme.

You should import one of this in your global style.scss like this @import "~vue-snotify/styles/material"; or @import "~vue-snotify/styles/material.css"; if you using css syntax.
Snotify offers you 3 themes.
Material
@import "~vue-snotify/styles/material";

Simple
@import "~vue-snotify/styles/simple";

Dark
@import "~vue-snotify/styles/dark";

If you need something else you can easily create your own theme by duplicating one of this, and writing your own styles.
